// A simple function for checking if a connection is successful or not
func isOpen(ip string, port int) bool {
	address := fmt.Sprintf("%s:%d", ip, port)

	// Attempt opening a connection at the given address
	conn, err := net.Dial("tcp", address)
	if err != nil {
		return false
	}

	// If the connection is established successfully, close it
	defer conn.Close()
	return true
}

